Documentary about the Debbie Harry-fronted New York band 
Blondie, who crossed pop with punk, reggae and rap and had 
no 1's in all styles, from their Bowery beginnings at CBGBs 
in 1974 to their controversial induction into the Rock 'n' 
Roll Hall of Fame. With exclusive backstage and performance 
footage from their 2006 UK tour, plus in-depth interviews 
with current and ex-band members and friends Iggy Pop, 
Shirley Manson, Tommy Ramone, and Chris Frantz and 
Tina Weymouth of Talking Heads.

